import React, { useState } from 'react';

function AddEducatorToaTOurnament() {
    const [requesterId, setRequesterId] = useState('');
    const [educatorId, setEducatorId] = useState('');
    const [tournamentId, setTournamentId] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        // Qui puoi aggiungere la logica per inviare i dati al server
        console.log({ requesterId, educatorId, tournamentId });
        alert('Educator Added Successfully!');
    };

    return (
        <form onSubmit={handleSubmit}>
            <div className="input-group">
                <label>ID Educator (Requester): </label>
                <input
                    type="text"
                    value={requesterId}
                    onChange={(e) => setRequesterId(e.target.value)}
                />
            </div>

            <div className="input-group">
                <label>ID Educator (To Add): </label>
                <input
                    type="text"
                    value={educatorId}
                    onChange={(e) => setEducatorId(e.target.value)}
                />
            </div>

            <div className="input-group">
                <label>ID Tournament: </label>
                <input
                    type="text"
                    value={tournamentId}
                    onChange={(e) => setTournamentId(e.target.value)}
                />
            </div>

            <button type="submit">Add Educator</button>
        </form>
    );
}

export default AddEducatorToaTOurnament;
